const video = wwLib.getFrontDocument().querySelector('.video-element');
video.muted = true;

const label = document.createElement('div');
label.style.position = 'absolute';
label.style.top = '10px'; // Margin from the top
label.style.left = '10px'; // Margin from the left
label.style.color = 'white';
label.style.fontSize = '1.5em';
label.style.padding = '1vw';
label.style.background = 'rgba(0, 0, 0, 0.9)';
label.style.borderRadius = '10px';
label.style.cursor = 'pointer';
label.innerHTML = '<i class="fas fa-volume-up" style="margin-right: 10px;"></i> Click To Unmute';

video.play().catch(() => {
  video.muted = true;
  video.play();
}).then(() => {
  video.parentNode.insertBefore(label, video.nextSibling);
  label.addEventListener('click', function() {
    video.muted = false;
    video.currentTime = 0;
    video.play();
    label.style.display = 'none';
  });
});
